# Read two integers from input
x, a = map(int, input().split()) # map(int, input().split())

# If x is less than a, print 0; otherwise, print 10
if x < a:
    print(0) # print(0)
else:
    print(10) # print(10)


def main():
    # Read input
    x = int(input())
    a = int(input())

    # Compare the two values and print the result.
    if x < a:
        print(0)
    else:
        print(10)

if __name__ == '__main__':
    main()


